import React from 'react';
import './side_drawer.css';

import HomeWorkRounded from '@material-ui/icons/HomeWorkRounded';
import Notification from '@material-ui/icons/Notifications';
import { FaHandHoldingHeart } from 'react-icons/fa';

function SideDrawer({show}) {

	let drawerClasses = "sideDrawer";
	if(show) {
		drawerClasses = "sideDrawer open";
	}

	return (
		<nav className={`${drawerClasses} bg-white h-full w-4/6 fixed shadow-lg top-0 left-0 z-20`}>
			<ul className="flex flex-col p-4 h-full list-none">
				<li className="hover:text-yellow-500 active:bg-yellow-500">
					<button className="flex items-center mt-8 px-2 hover:bg-gray-100   rounded-md">
						<HomeWorkRounded style={{fontSize: 38}} />
						{/* {selectedNav ? <HomeWorkRounded style={{fontSize: 42, color:"rgba(245, 158, 11)"}} /> : 	<HomeWorkRounded style={{ fontSize: 42}} />} */}

						<div className={`font-face-gm text-xl ml-2`}>
							Home
						</div>
					</button>
				</li>

				<li className="hover:text-yellow-500 active:bg-yellow-500">
					<button className="flex items-center mt-8 px-2 hover:bg-gray-100   rounded-md">
						<Notification style={{fontSize: 38}} />
						{/* {selectedNav ? <HomeWorkRounded style={{fontSize: 42, color:"rgba(245, 158, 11)"}} /> : 	<HomeWorkRounded style={{ fontSize: 42}} />} */}

						<div className={`font-face-gm text-xl ml-2`}>
							Notifications
						</div>
					</button>
				</li>

				<li className="hover:text-yellow-500 active:bg-yellow-500">
					<button className="flex items-center mt-8 px-2 hover:bg-gray-100   rounded-md">
						<FaHandHoldingHeart size="38"  />
						{/* {selectedNav ? <HomeWorkRounded style={{fontSize: 42, color:"rgba(245, 158, 11)"}} /> : 	<HomeWorkRounded style={{ fontSize: 42}} />} */}

						<div className={`font-face-gm text-xl ml-2`}>
							Notifications
						</div>
					</button>
				</li>
			</ul>
		</nav>
	);
}

export default SideDrawer;
